import React, { useEffect, useState } from 'react';

import {BrowserRouter, Route, Link } from 'react-router-dom';


const Title = () => {

    return ( <BrowserRouter>

        <div id="title">

        <header>
            <Link to="/posts">Posts</Link>
        </header>

        <div>
            <switch>
                <Route path="/posts">
                    Testing Text
                </Route>
            </switch>
        </div>

        </div>

        </BrowserRouter>
    )
}

